#include <bits/stdc++.h>using namespace std;const int N = 200005;vector<int> adj[N];int deg[N];bool chk=0;bitset<N> in;priority_queue<int,vector<int>,greater<int>> pq;int main(){	int n,m;	cin>>n>>m;	for(int i=0;i<m;i++){		int a,b;		cin>>a>>b;		adj[a].push_back(b);		deg[b]++;	}	for(int i=1;i<=n;i++){        if(deg[i] == 0){            pq.push(i);        }    }	vector<int> res;	while(!pq.empty()){		int u=pq.top();		pq.pop();		res.push_back(u);		for(int v:adj[u]){			--deg[v];			if(deg[v]==0){				pq.push(v);			}		}	}	if (res.size()!=n) cout << "IMPOSSIBLE"; else	for(int i = 0; i < n; i++) cout << res[i] << " ";}